pragma solidity >= 0.7.0 < 0.9.0;

import "../node_modules/@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract Market {

    enum ListingStatus {
        Active,     // C th mua
        Sold,       //  bn 
        Cancelled   //  tho khi ch
    }

    struct Listing {            // Item trong danh sch
        ListingStatus status;   // Trng thi ca 
        address seller;         // a ch v ca ngi bn
        address token;          // a ch ca NFT
        uint tokenId;           // ID ca token
        uint price;             // Gi ca token trn sn
    }

    event Listed(
        uint listingId,
        address sender,
        address token,
        uint tokenId,
        uint price
    );

    event Sale(
        uint listingId,
        address sender,
        address token,
        uint tokenId,
        uint price
    );

    event Cancel(
        uint listingId,
        address sender
    );

    // S lng NFT  c a ln sn
    uint private _listingId = 0;
    // Map cha cc NFT
    mapping(uint => Listing) private _listings;

    // Hm thc hin lnh a token ln sn
    function listToken(address token, uint tokenId, uint price) external {
        // Chuyn NFT n a ch ca Market
        IERC721(token).transferFrom(msg.sender, address(this), tokenId);

        // To mt item 
        // Trng thi NFT l C th mua
        // a ch ngi bn l v ca ngi thc hin lnh listToken
        Listing memory listing = Listing(
            ListingStatus.Active,
            msg.sender, 
            token, 
            tokenId, 
            price * 1 ether
        );

        // Tng s lng NFT  ln sn
        _listingId++;
        // Thm item vo list item c trn sn
        _listings[_listingId] = listing;

        // Thng bo event  list sn
        emit Listed (
            _listingId,
            msg.sender,
            token,
            tokenId,
            price
        );
    }

    function getListing(uint listingId) public view returns (Listing memory) {
        return _listings[listingId];
    }

    // Hm thc hin lnh mua token
    // Lnh "msg.value" v "callvalue()" ch c th thc hin nu 
    //      l hm "payable" hoc "internal" hm
    // Cn ly s d trong v  kim tra xem c   mua token
    //      hay khng
    function buyToken(uint listingId) external payable{
        // Chn vo NFT cn mua
        Listing storage listing = _listings[listingId];

        // Ngi mua phi khc ngi bn
        // Kim tra bng cch so snh a ch ca ngi thc hin lnh mua
        //      vi a ngi bn
        // Nu sai th thng bo "Ngi bn khng th l ngi mua"
        require(msg.sender != listing.seller, "Seller cannot be buyer");

        // Item phi trong trng thi sn sng  mua
        // Nu sn phm khng trong trng thi c th mua
        //      thng bo "Danh sch khng hot ng
        require(listing.status == ListingStatus.Active, "Listing is not active");
        
        // S tin trong v ngi mua phi ln hn hoc bng
        //      vi gi ca NFT, nu khng
        //      thng bp "Khng   thanh ton"  
        require(msg.value >= listing.price, "Insufficient payment");

        // Chuyn trng thi NFT v  mua
        listing.status = ListingStatus.Sold;
        
        // Nu tt c cc kim tra trn ng ngha l ngi dng 
        //      iu kin mua, ta chuyn token n v ca ngi mua
        IERC721(listing.token).transferFrom(address(this), msg.sender, listing.tokenId);

        // Chuyn tin cho ngi bn token
        // S tin chuyn bng vi gi token lc list sn
        payable(listing.seller).transfer(listing.price);


        // Thng bo event  bn
        emit Sale (
            listingId,
            msg.sender,
            listing.token,
            listing.tokenId,
            listing.price
        );
    } 

    // Hm thu hi NFT khi list
    function cancel(uint listingId) public {
        // Chn vo NFT cn b khi sn
        Listing storage listing = _listings[listingId];
        
        // Ngi hy NFT khi list phi l ngi bn
        // Nu khng, thng bo "Ch ngi bn mi 
        //      c th hy b danh sch"
        require(msg.sender == listing.seller, "Only seller can cancel listing");
        // NFT phi ang  trng thi sn sng
        // Nu khng, thng bo "Danh sch khng hot ng"
        require(listing.status  == ListingStatus.Active, "Listing is not active");

        // Nu kim tra tt c thnh cng
        // Trng thi ca NFT trn sn tr thnh  a v v
        listing.status = ListingStatus.Cancelled;

        // NFT c tr v v ngi bn
        IERC721(listing.token).transferFrom(address(this), msg.sender, listing.tokenId);

        // Thng bo event  cancel
        emit Cancel(listingId, listing.seller);
    }
}
